import React from 'react';
import myntraLogo from './myntra.svg';
import './App.css';

function App() {
  return (
    <>
<nav class="navbar navbar-expand-lg navbar-light bg-light">
  <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
    <div class="navbar-nav">
    <a className="navbar-brand" href="#">
          <img src={myntraLogo} width="30" height="30" alt="Myntra Logo"/>
        </a>
      <a class="nav-item nav-link active" href="#">Home </a>
      <a class="nav-item nav-link active" href="#">About Us </a>
      <a class="nav-item nav-link active" href="#">Contact Us </a>
      <button class="btn btn-outline-success my-2 my-sm-0" type="submit">Work with Us</button>
    </div>
  </div>
</nav>
    </>
  );
}


export default App;
